    "A Laser-Based Diagnostic Suite for Hypersonic Test Facilities Project",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T03:44:26.349775",nt"name": "a-laser-based-diagnostic-suite-for-hypersonic-test-facilities-project",nt"isopen":
    true,nt"url": null,nt"notes": "In this SBIR effort, Los Gatos Research
    (LGR) proposes to develop a suite of laser-based diagnostics for the study of reactive
    and non-reactive hypersonic flows.  These sensors will include both in situ and
    line-of-sight measurements of several critical parameters including gas temperature,
    velocity, and composition.  Both established near-infrared and emerging mid-infrared
    laser sources will be utilized to make highly-accurate measurements via tunable
    diode laser absorption spectrometry.  The SBIR instrument will be the first system
    capable of providing real-time, rapid quantification of these important combustion
    parameters in NASA's hypersonic wind tunnels.  Such quantification is essential
    to the development of improved reactive CFD models and subsequent hypersonic propulsion
    systems for future aerospace vehicles.",nt"license_title": "U.S. Government
